    <div
      className={`chat-message ${
        content.role === "assistant" ? "chatgpt" : ""
      }`}
    >
      <div className="chat-message-center">
        <div
          className={`avatar ${content.role === "assistant" ? "chatgpt" : ""}`}
        >
          {content.role === "assistant" && (
            <svg
              xmlns="http://www.w3.org/2000/svg"
              width={41}
              height={41}
              fill="none"
              strokeWidth={1.5}
              className="h-6 w-6"
            >
              <path
